(229, 'AE', 'United Arab Emirates', 'united-arab-emirates', 'upload/country_img/325816972.png', 'The United Arab Emirates is known its for two largest cities Dubai and Abu Dhabi, which attracts millions of tourists every year. Dubai, regional business center known for its imposing skyscrapers, is home to the worlds tallest building- Burj Khalifa .  Economic and political stability, religiously and culturally tolerant population, a range of events and activities make UAE an ideal tourist destination.  The best time to visit UAE can be considered during the months of November to march, when the weather is neither too hot not too humid, making it perfect for sightseeing and travel. It cannot really be called winter as the temperature rarely drops below 12 c. it is the hottest time of the year in united Arab Emirates.'),
(230, 'GB', 'United Kingdom', 'united-kingdom', '', NULL),
(231, 'US', 'United States', 'united-states', 'upload/country_img/1099725380.jpg', 'The United States (U.S) is one of the most popular travel tourist destinations around the world. Each year, the countrys famous cities, national parks and entertainment options attract millions of visitors from around the world. From the skyscrapers of New York and Chicago, the natural wonders of Yellowstone and Alaska, to the sunny beaches of California, Florida, and Hawaii, the United States has an amazing amount of tourist destinations. The best time to visit u.s is either during spring (early march to late may) or autumn (early September to late October). Since these are the shoulder seasons before and after summer, these months tend to have warmer temperatures as well as fewer visitors to the most popular destinations.'),
